	[intGroupSort] = ISNULL(@intGroupSort, 1), 
	[intNameSort] = ISNULL(@intNameSort, 0) + 1, 
	[intConcurrencyId] = 1

SELECT @intReportId = SCOPE_IDENTITY()

-- Setup for the data source
INSERT [dbo].[tblRMDatasource] (
	[strName], 
	[intReportId], 
	[intConnectionId], 
	[strQuery], 
	[intDataSourceType], 
	[intConcurrencyId]
)
SELECT 
	[strName] = NULL, 
	[intReportId] = @intReportId, 
	[intConnectionId] = 1, 
	[strQuery] = N'
	SELECT DISTINCT

	-- Bank Transaction
	tblCMBankTransaction.dtmDate
	,tblCMBankTransaction.strReferenceNo as strCheckNumber
	,ABS(tblCMBankTransaction.dblAmount) as dblAmount
	,tblCMBankTransaction.strPayee
	,strAmountInWords = LTRIM(RTRIM(REPLACE(tblCMBankTransaction.strAmountInWords, ''*'', ''''))) + REPLICATE('' *'', 30)
	,tblCMBankTransaction.strMemo
	,tblCMBankTransaction.strTransactionId
	,tblCMBankTransaction.intTransactionId
	,tblCMBankTransaction.intBankAccountId
	,tblCMBankTransaction.dtmCheckPrinted
	,tblCMCheckPrintJobSpool.strBatchId

	-- Employee
	,tblPREmployeeInfo.strEmployeeId
	,tblPREmployeeInfo.strFirstName
	,tblPREmployeeInfo.strMiddleName
	,tblPREmployeeInfo.strLastName
	,tblPREmployeeInfo.strNameSuffix
	,tblPREmployeeInfo.strPayPeriod
	,strEmployeeAddress = CASE WHEN ISNULL(dbo.fnConvertToFullAddress(tblPREmployeeInfo.strAddress, tblPREmployeeInfo.strCity, tblPREmployeeInfo.strState, tblPREmployeeInfo.strZipCode), '''') <> '''' 
							   THEN dbo.fnConvertToFullAddress(tblPREmployeeInfo.strAddress, tblPREmployeeInfo.strCity, tblPREmployeeInfo.strState, tblPREmployeeInfo.strZipCode) 
							   ELSE dbo.fnConvertToFullAddress(tblCMBankTransaction.strAddress, tblCMBankTransaction.strCity, tblCMBankTransaction.strState, tblCMBankTransaction.strZipCode)

	END

	-- Paycheck
	, tblPRPaycheck.intPaycheckId 
	, ISNULL(tblPRPaycheck.dtmDateFrom, null) AS dtmDateFrom 
	, ISNULL(tblPRPaycheck.dtmDateTo, null) AS dtmDateTo 
	, ISNULL(tblPRPaycheck.dblGross, 0) AS dblGross 
	, ISNULL(tblPRPaycheck.dblTaxTotal, 0) AS dblTaxTotal 
	, ISNULL(tblPRPaycheck.dblDeductionTotal, 0) AS dblDeductionTotal 
	, ISNULL(tblPRPaycheck.dblNetPayTotal, 0) AS dblNetPayTotal
	, tblPRPaycheck.ysnVoid 

	-- Paycheck Summary (YTD)
	, dblGrossYTD = SUM(ISNULL(vyuPRPaycheckYTD.dblGrossYTD,0)) 
	, dblTaxYTD = SUM(ISNULL(vyuPRPaycheckYTD.dblTaxTotalYTD,0)) 
	, dblDeductionYTD = SUM(ISNULL(vyuPRPaycheckYTD.dblDeductionTotalYTD,0)) 
	, dblNetYTD = SUM(ISNULL(vyuPRPaycheckYTD.dblNetPayTotalYTD,0)) 

	FROM tblPRPaycheck 
		 -- Join to Employee
		 LEFT JOIN (SELECT tblPREmployee.*, 
							tblEMEntity.strName, 
							tblEMEntityLocation.strAddress, 
							tblEMEntityLocation.strCity, 
							tblEMEntityLocation.strState, 
							tblEMEntityLocation.strZipCode 
					  FROM tblPREmployee 
						LEFT JOIN tblEMEntity 
						ON tblPREmployee.intEntityEmployeeId = tblEMEntity.intEntityId
						LEFT JOIN tblEMEntityLocation
						ON tblPREmployee.intEntityEmployeeId = tblEMEntityLocation.intEntityId
							AND tblEMEntityLocation.ysnDefaultLocation = 1) tblPREmployeeInfo
				ON tblPRPaycheck.intEntityEmployeeId = tblPREmployeeInfo.intEntityEmployeeId 
		 -- Join to Paycheck Summary (YTD)
		 LEFT JOIN vyuPRPaycheckYTD
				ON tblPRPaycheck.intPaycheckId = vyuPRPaycheckYTD.intPaycheckId 
				AND YEAR(tblPRPaycheck.dtmPayDate) = YEAR(vyuPRPaycheckYTD.dtmPayDate) 
				AND CAST(FLOOR(CAST(tblPRPaycheck.dtmPayDate AS FLOAT)) AS DATETIME) >= CAST(FLOOR(CAST(vyuPRPaycheckYTD.dtmPayDate AS FLOAT)) AS DATETIME) 
		 -- Join to Bank Transaction
		 LEFT JOIN tblCMBankTransaction 
				ON tblCMBankTransaction.strTransactionId = tblPRPaycheck.strPaycheckId
		 INNER JOIN tblCMCheckPrintJobSpool
				ON tblCMBankTransaction.intTransactionId = tblCMCheckPrintJobSpool.intTransactionId
	WHERE tblCMBankTransaction.intBankTransactionTypeId = 21

	GROUP BY tblCMBankTransaction.dtmDate
	,tblCMBankTransaction.strReferenceNo
	,tblCMBankTransaction.dblAmount
	,tblCMBankTransaction.strPayee
	,tblCMBankTransaction.strAmountInWords
	,tblCMBankTransaction.strMemo
	,tblCMBankTransaction.strTransactionId
	,tblCMBankTransaction.intTransactionId
	,tblCMBankTransaction.intBankAccountId
	,tblCMBankTransaction.dtmCheckPrinted
	,tblCMBankTransaction.strAddress
	,tblCMBankTransaction.strCity
	,tblCMBankTransaction.strState
	,tblCMBankTransaction.strZipCode
	,tblCMCheckPrintJobSpool.strBatchId
	,tblPREmployeeInfo.strEmployeeId
	,tblPREmployeeInfo.strFirstName
	,tblPREmployeeInfo.strMiddleName
	,tblPREmployeeInfo.strLastName
	,tblPREmployeeInfo.strNameSuffix
	,tblPREmployeeInfo.strPayPeriod
	,tblPREmployeeInfo.strAddress 
	,tblPREmployeeInfo.strCity
	,tblPREmployeeInfo.strState
	,tblPREmployeeInfo.strZipCode
	,tblPRPaycheck.intPaycheckId 
	,tblPRPaycheck.dtmDateFrom
	,tblPRPaycheck.dtmDateTo 
	,tblPRPaycheck.dblGross
	,tblPRPaycheck.dblTaxTotal
	,tblPRPaycheck.dblDeductionTotal
	,tblPRPaycheck.dblNetPayTotal
	,tblPRPaycheck.ysnVoid', 
	[intDataSourceType] = 0, 
	[intConcurrencyId] = 1
	

-- Setup for the report settings
-- Setup the first sub report (Paycheck Earning Sub Report)
BEGIN 
	SELECT	@intSubreportId = [intReportId]
	FROM	[dbo].[tblRMReport]
	WHERE	[strName] = N'Paycheck Earning Sub Report'

	IF (@intSubreportId IS NOT NULL)
	BEGIN 
		-- Setup the first sub report control
		INSERT [dbo].[tblRMSubreportSetting] (
			[intReportId], 
			[strControlName], 
			[intSubreportId], 
			[intConcurrencyId]
		)
		SELECT 
			[intReportId] = @intReportId,
			[strControlName] = N'PaycheckTopEarning1', 
			[intSubreportId] = @intSubreportId, 
			[intConcurrencyId] = 1

		SELECT @intSubreportSettingId = SCOPE_IDENTITY()

		IF (@intSubreportSettingId IS NOT NULL) 
		BEGIN 
			-- Setup the sub report filter 
			INSERT INTO [dbo].[tblRMSubreportFilter](
				[intSubreportSettingId]
				,[intType]
				,[strParentField]
				,[strParentDataType]
				,[strChildField]
				,[strChildDataType]
				,[intConcurrencyId]
			)
			SELECT 
				[intSubreportSettingId] = @intSubreportSettingId
				,[intType] = 0
				,[strParentField] = 'intPaycheckId'
				,[strParentDataType] = 'Integer'
				,[strChildField] = 'intPaycheckId'
				,[strChildDataType] = 'Integer'
				,[intConcurrencyId] = 1
		END 

		-- Setup the second sub report control
		INSERT [dbo].[tblRMSubreportSetting] (
			[intReportId], 
			[strControlName], 
			[intSubreportId], 
			[intConcurrencyId]
		)
		SELECT 
			[intReportId] = @intReportId,
			[strControlName] = N'PaycheckTopEarning2', 
			[intSubreportId] = @intSubreportId, 
			[intConcurrencyId] = 1

		SELECT @intSubreportSettingId = SCOPE_IDENTITY()

		IF (@intSubreportSettingId IS NOT NULL) 
		BEGIN 
			-- Setup the sub report filter 
			INSERT INTO [dbo].[tblRMSubreportFilter](
				[intSubreportSettingId]
				,[intType]
				,[strParentField]
				,[strParentDataType]
				,[strChildField]
				,[strChildDataType]
				,[intConcurrencyId]
			)
			SELECT 
				[intSubreportSettingId] = @intSubreportSettingId
				,[intType] = 0
				,[strParentField] = 'intPaycheckId'
				,[strParentDataType] = 'Integer'
				,[strChildField] = 'intPaycheckId'
				,[strChildDataType] = 'Integer'
				,[intConcurrencyId] = 1
		END 
	END
END 

